import React, { useState } from 'react';
import About from './About';
import axios from 'axios';
import AddLivre from './AddLivre';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
const App = () => {


    return (
        <div>
            <About />

            <BrowserRouter>
                <Routes>
                    <Route path='/about' element={<About />} />
                </Routes>
            </BrowserRouter>

        </div >
    );
};

export default App;
